INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 24001, 401, 2, 0.0, 24, 2, 102301, 10046, 0.0, "アヤネ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2.21, 24002, 402, 1, 0.0, 24, 2, 102301, 10046, 0.0, "アヤネ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 24003, 403, 2, 0.0, 24, 2, 102301, 10046, 0.0, "アヤネ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1.99, 24004, 701, 2, 0.0, 24, 1, 192201, 10046, 0.0, "アサヒ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2.21, 24005, 702, 1, 0.0, 24, 2, 192201, 10046, 0.0, "アサヒ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 3.33, 24006, 703, 2, 0.0, 24, 1, 192201, 10046, 0.0, "アサヒ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 24007, 801, 2, 0.0, 24, 2, 192301, 10046, 0.0, "部員３", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2.68, 24008, 802, 1, 0.0, 24, 2, 192301, 10046, 0.0, "部員３", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 24009, 803, 2, 0.0, 24, 2, 192301, 10046, 0.0, "部員３", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "やった！", 0.0, 24010, 501, 1, 0.0, 24, 1, 192501, 10046, 0.0, "", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "勝ったよ！", 0.0, 24011, 502, 1, 0.0, 24, 1, 192501, 10046, 0.0, "", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "いい調子！", 0.0, 24012, 503, 1, 0.0, 24, 1, 192501, 10046, 0.0, "", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 5.33, 24013, 111, 6, 0.0, 24, 2, 113501, 10046, 0.0, "ミサト", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 6.85, 24014, 112, 1, 0.0, 24, 2, 113501, 10046, 0.0, "ミサト", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 3.0, 24015, 113, 1, 0.0, 24, 2, 113501, 10046, 0.0, "ミサト", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 6.11, 24016, 611, 1, 0.0, 24, 2, 192401, 10046, 0.0, "ダイチ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 6.75, 24017, 612, 1, 0.0, 24, 2, 192401, 10046, 0.0, "ダイチ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 24018, 613, 2, 0.0, 24, 2, 192401, 10046, 0.0, "ダイチ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 4.52, 24019, 211, 2, 0.0, 24, 1, 113401, 10046, 0.0, "ハツネ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 3.89, 24020, 212, 2, 0.0, 24, 1, 113401, 10046, 0.0, "ハツネ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 13.49, 24021, 213, 1, 0.0, 24, 2, 113401, 10046, 0.0, "ハツネ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 3.17, 24022, 311, 1, 0.0, 24, 2, 106501, 10046, 0.0, "カヤ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 4.42, 24023, 312, 1, 0.0, 24, 2, 106501, 10046, 0.0, "カヤ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 2.89, 24024, 313, 6, 0.0, 24, 1, 106501, 10046, 0.0, "カヤ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3.71, 24025, 421, 4, 0.0, 24, 3, 102301, 10046, 0.0, "アヤネ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 5.1, 24026, 721, 2, 0.0, 24, 1, 192201, 10046, 0.0, "アサヒ", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 4.34, 24027, 821, 1, 0.0, 24, 3, 192301, 10046, 0.0, "部員３", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "いい勝負だったよ\nまたやろうね", 0.0, 24028, 521, 1, 0.0, 24, 1, 192501, 10046, 0.0, "", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 5.62, 24029, 101, 1, -360.0, 24, 2, 113501, 10046, 0.0, "ミサト", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 9.58, 24030, 102, 1, -360.0, 24, 2, 113501, 10046, 0.0, "ミサト", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 24031, 103, 2, -360.0, 24, 2, 113501, 10046, 0.0, "ミサト", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 9.13, 24032, 104, 2, -360.0, 24, 1, 113501, 10046, 0.0, "ミサト", "2030/12/17 14:59:59");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("2020/07/31 12:00:00", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 8.27, 24033, 105, 1, -360.0, 24, 2, 113501, 10046, 0.0, "ミサト", "2030/12/17 14:59:59");
